import React from 'react';

import './Style.css';

const Card = (props) => {
    return (
        <div>
           <div className='Cardcmp'>
               <div classname='imgcard'>
                    <img src={props.src} alt='image'/>
               </div>
               <div classname='details'>
               <h1>{props.title}</h1>
               <p>{props.details}</p>
               </div>
           </div>
            
            

        </div>
    );
}

export default Card;
